import React from 'react';
import styles from './Dashboard.module.css';

export const RoomCard = ({ type, deals, available, total, price }) => {
  return (
    <div className={styles.roomCard}>
      <div className={styles.roomCardHeader}>
        {deals && <div className={styles.dealsBadge}>{deals} Deals</div>}
        <img src="/icons/room.svg" alt={`${type} icon`} />
      </div>
      <div className={styles.roomType}>{type}</div>
      <div className={styles.roomAvailability}>
        {available}/{total}
      </div>
      <div className={styles.priceAmount}>${price}</div>
      <div className={styles.priceUnit}>/ day</div>
    </div>
  );
};
